INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (24, 4, "2019/07/31 12:00:00", 4, 110501, "2030/12/17 14:59:59", 0.0, 24015, 10021, 1, 0.0, 0.0, "カオリ（サマー）", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？");
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (24, 4, "2019/07/31 12:00:00", 1, 110501, "2030/12/17 14:59:59", 0.0, 24016, 10021, 2, 4.0, 0.0, "カオリ（サマー）", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！");
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (24, 4, "2019/07/31 12:00:00", 4, 110501, "2030/12/17 14:59:59", 0.0, 24017, 10021, 3, 0.0, 0.0, "カオリ（サマー）", "マジムンだらけで目が回るさ～！\nふらふらさ～！");
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (24, 1, "2019/07/31 12:00:00", 2, 110501, "2030/12/17 14:59:59", 0.0, 24018, 10021, 4, 5.2, 0.0, "カオリ（サマー）", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！");
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (24, 5, "2019/07/31 12:00:00", 6, 110501, "2030/12/17 14:59:59", 0.0, 24019, 10021, 5, 4.2, 0.0, "カオリ（サマー）", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？");
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (24, 2, "2019/07/31 12:00:00", 2, 110501, "2030/12/17 14:59:59", 0.0, 24020, 10021, 6, 0.0, 0.0, "カオリ（サマー）", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！");
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (24, 1, "2019/07/31 12:00:00", 6, 110501, "2030/12/17 14:59:59", 0.0, 24021, 10021, 7, 6.4, 0.0, "カオリ（サマー）", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？");
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (24, 2, "2019/07/31 12:00:00", 2, 110501, "2030/12/17 14:59:59", 0.0, 24022, 10021, 8, 0.0, 0.0, "カオリ（サマー）", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！");
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (24, 6, "2019/07/31 12:00:00", 3, 110501, "2030/12/17 14:59:59", 0.0, 24023, 10021, 9, 10.08, 0.0, "カオリ（サマー）", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？");
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (24, 1, "2019/07/31 12:00:00", 2, 110501, "2030/12/17 14:59:59", 0.0, 24024, 10021, 10, 5.0, 0.0, "カオリ（サマー）", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪");
INSERT INTO `v1_2ba9cca2eedb77357fffe03c06691c532a69e2fee751f1574a94fffd1371fdf1` VALUES (24, 2, "2019/07/31 12:00:00", 2, 110501, "2030/12/17 14:59:59", 0.0, 24025, 10021, 11, 0.0, 0.0, "カオリ（サマー）", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！");
